import { createBrowserRoute, RouterProvider} from 'react-router-dom';
import { Panel } from "./Navigator";
import { Field } from "./PlayField";

const router = createBrowserRoute([
  {
    path: '/',
    element: <Panel/>
  }
])


function App() {
  var userLog = false

  if (userLog == false) {
    return (
      <div className="App">
        <Panel />
        <Field />
      </div>
    )
  } else {
    return (
      <div className="App">
        <Panel />
        <Field />
      </div>
    )
  }
}

export default App;
